/**
 * @param {string} s
 * @param {number} maxLetters
 * @param {number} minSize
 * @param {number} maxSize
 * @return {number}
 */
var maxFreq = function(s, maxLetters, minSize, maxSize) {
  let max = 0;
  const valid = str => {
    if (str.length > maxSize || str.length < minSize) {
      // console.log('TCL: str', str);
      // console.log('TCL: str.length > maxSize || str.length < minSize', str.length > maxSize || str.length < minSize);
      return false;
    }
    let letters = {};
    let letterCount = 0;
    for (let i = 0; i < str.length; i++) {
      const element = str[i];
      if (!letters[element]) {
        letterCount += 1;
        if (letterCount > maxLetters) {
          // console.log('TCL: s', s);
          // console.log('TCL: letterCount', letterCount);
          return false;
        }
        letters[element] = true;
      }
    }
    return true;
  };
  const canContinue = str => {
    if (str.length > maxSize) {
      return false;
    }
    let letters = {};
    let letterCount = 0;
    for (let i = 0; i < str.length; i++) {
      const element = str[i];
      if (!letters[element]) {
        letterCount += 1;
        if (letterCount > maxLetters) {
          // console.log('TCL: s', s);
          // console.log('TCL: letterCount', letterCount);
          return false;
        }
        letters[element] = true;
      }
    }
    return true;
  };
  const dp = [];
  const dp1 = {};
  for (let i = 0; i < s.length; i++) {
    const element = s[i];
    if (dp1[element]) {
      dp1[element].push(i);
      if (valid(element) && dp1[element].length > max) {
        max = dp1[element].length;
      }
    } else {
      dp1[element] = [i];
      if (valid(element) && max === 0) {
        max = 1;
      }
    }
  }
  dp.push(dp1);
  for (let i = 2; i <= maxSize; i++) {
    const dpN = {};
    // const map = {};
    // for (let j = i - 1; j < s.length; j++) {
    //   const element = s[j];
    //   if (map[element]) {
    //     map[element][j] = true;
    //   } else {
    //     map[element] = {
    //       j: true
    //     };
    //   }
    // }
    for (const key in dp[i - 2]) {
      if (dp[i - 2].hasOwnProperty(key)) {
        const indices = dp[i - 2][key];
        for (let j = 0; j < indices.length; j++) {
          const index = indices[j];
          if (index + i - 1 >= s.length) {
            continue;
          }
          const newS = key + s[index + i - 1];
          if (!canContinue(newS)) {
            continue;
          }
          // console.log('TCL: newS', newS);
          // console.log('TCL: s', s);
          // console.log('TCL: index + i', index + i);
          if (dpN[newS]) {
            dpN[newS].push(index);
            // console.log('TCL: dpN[newS].length', dpN[newS].length);
            // console.log('TCL: valid(newS)', valid(newS));
            // console.log('TCL: newS', newS);
            if (valid(newS) && dpN[newS].length > max) {
              max = dpN[newS].length;
            }
          } else {
            dpN[newS] = [index];
            if (valid(newS) && max === 0) {
              max = 1;
            }
          }
        }
      }
    }
    dp.push(dpN);
  }
  // console.log(dp.length);
  // console.log('TCL: dp.length', dp.length);
  return max;
};

console.log(maxFreq('aababcaab', 2, 3, 4));
console.log(maxFreq('aaaa', 1, 3, 3));
console.log(maxFreq('aabcabcab', 2, 2, 3));
console.log(maxFreq('abcde', 2, 3, 3));
console.log(maxFreq('abcde', 2, 1, 3));
console.log(maxFreq('', 7, 4, 23));
